import { useState } from "react";
import "./AIEvents.css";

const aiEvent=()=> {


  const handleModelChange = (e) => {
    setSelectedModel(e.target.value);
  };

  const handleDateSelection = (date) => {
    setSelectedDate(date);
  };
  return (
    <>
      <div className="ai-events-container">
        <div className="ai-header">
        <div>
        <h1 className="title">AI Events</h1>
        <p className="subtitle">List of events triggered by cameras</p>
        </div>
        <div>
           {/* Tabs */}
        <div className="tabs-container">
          <button className="tab-button active">Events</button>
          <button className="tab-button">Notifications</button>
          <button className="tab-button">Reports</button>
        </div>
        <div className="week-navigation">
            <select className="device-dropdown">
              <option value="All Device">All Device</option>
              {/* Add more devices here */}
            </select>
            <div className="week-buttons">
              <button className="week-button">previous week</button>
              <button className="week-button">next week</button>
            </div>
          </div>

        </div>
        </div>

        {/* Date Buttons */}
        <div className="date-buttons-container">
          {[
            "15 Jul",
            "16 Jul",
            "17 Jul",
            "18 Jul",
            "20 Jul",
            "21 Jul",
            "22 Jul",
          ].map((date) => (
            <button
              key={date}
              onClick={() => handleDateSelection(date)}
              className={`date-button ${
                date === selectedDate ? "selected" : ""
              }`}
            >
              {date}
            </button>
          ))}
        </div>

        {/* Filters */}
        <div className="dropdown-container">
      <select value={selectedModel} className="dropdown">
        <option value="All detection models">All detection models</option>
        <option value="Motion detection">Motion detection</option>
        <option value="Humanoid detection">Humanoid detection</option>
        <option value="Face detection">Face detection</option>
        <option value="Line crossing detection">Line crossing detection</option>
        <option value="Area detection">Area detection</option>
        <option value="Unattended baggage detection">Unattended baggage detection</option>
        <option value="Missing object detection">Missing object detection</option>
      </select>
      <button  className="clear-button">clear</button>
        </div>


      </div>
    </>
  );
}

export default aiEvent;
